/*Table structure for table `dimension_verb` */

DROP TABLE IF EXISTS `dimension_verb`;

CREATE TABLE `dimension_verb` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `sysname` char(100) NOT NULL,
  `name` char(100) DEFAULT NULL,
  `type` int(4) unsigned NOT NULL,
  `uri` char(255) DEFAULT NULL,
  `artefact_id` int(11) unsigned DEFAULT NULL, 
  PRIMARY KEY (`id`),
  UNIQUE KEY `sys_name` (`artefact_id`, `sysname`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `dimension_verb` */

/*Table structure for table `dirobjects` */

DROP TABLE IF EXISTS `dirobjects`;

CREATE TABLE `dirobjects` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `idnumber` varchar(255) DEFAULT NULL,
  `name` varchar(255) DEFAULT NULL,
  `artefact_id` int(11) unsigned DEFAULT NULL,
  `created` datetime DEFAULT NULL,
  `modified` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `artefact_ix` (`artefact_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `dirobjects` */

/*Table structure for table `fact_user_actions_date` */

DROP TABLE IF EXISTS `fact_user_actions_date`;

CREATE TABLE `fact_user_actions_date` (
  `user_id` int(11) unsigned NOT NULL,
  `artefact_id` int(11) unsigned NOT NULL,
  `dimension_verb_id` int(11) unsigned NOT NULL,
  `dimension_date_id` int(11) unsigned NOT NULL,
  `total` int(11) unsigned DEFAULT NULL,
  `production` int(11) unsigned DEFAULT NULL,
  `consumption` int(11) unsigned DEFAULT NULL,
  `exchange` int(11) unsigned DEFAULT NULL,
  `distribution` int(11) unsigned DEFAULT NULL,
  `operation` int(11) unsigned DEFAULT NULL,
  PRIMARY KEY (`user_id`,`artefact_id`,`dimension_verb_id`,`dimension_date_id`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1 COLLATE=latin1_general_ci;

/*Data for the table `fact_user_actions_date` */

/*Table structure for table `fact_user_actions_time` */

DROP TABLE IF EXISTS `fact_user_actions_time`;

CREATE TABLE `fact_user_actions_time` (
  `user_id` int(11) unsigned NOT NULL,
  `dimension_time_id` int(11) unsigned NOT NULL,
  `total` int(11) unsigned DEFAULT NULL,
  PRIMARY KEY (`user_id`,`dimension_time_id`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1 COLLATE=latin1_general_ci;

/*Data for the table `fact_user_actions_time` */

/*Table structure for table `groups` */

DROP TABLE IF EXISTS `groups`;

CREATE TABLE `groups` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `sysid` int(11) unsigned DEFAULT NULL,
  `idnumber` varchar(255) DEFAULT NULL,
  `name` varchar(255) DEFAULT NULL,
  `type` varchar(255) DEFAULT NULL,
  `system_id` int(11) unsigned DEFAULT NULL,
  `community_id` int(11) unsigned DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `system_group` (`system_id`, `sysid`),
  KEY `community_ix` (`community_id`),
  KEY `system_ix` (`system_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `groups` */

/*Table structure for table `materials` */

DROP TABLE IF EXISTS `materials`;

CREATE TABLE `materials` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
